pragma solidity >=0.4.0 <0.7.0;
import "./User.sol";

contract Organization {
    struct Document {
        string url;
        string oid;
        string userId;
        string hasha;
    }
    string public id;
    string public name;
    string public secret;
    Document[] public issuedDocuments;

    constructor(
        string memory _name,
        string memory _secret,
        string memory _id
    ) public {
        id = _id;
        name = _name;
        secret = _secret;
    }

    //this also takes care of approveDocument, for which the doc will be first signed and then issueDoc will be called
    function issueDocument(
        string memory url,
        string memory hasha,
        string memory oid,
        string memory userId
    ) public returns (uint256) {
        Document memory newDoc = Document(url, oid, userId, hasha);
        uint256 l = issuedDocuments.length;
        issuedDocuments.push(newDoc);
        return l;
    }

    function deleteDocument(uint256 index) public {
        delete issuedDocuments[index];
    }

    // function verifyDocument(
